HQ very rare promo music video. &quot;I Feel Fine&quot; is a riff-driven rock song written by John Lennon (credited to LennonÃ¢â‚¬â€œMcCartney) and released in 1964 by the Beatles as the A-side of their eighth British single. The song is notable for being one of the first uses of guitar feedback in popular music.

Lennon wrote the guitar riff while in the studio recording &quot;Eight Days a Week&quot;. &quot;I wrote 'I Feel Fine' around that riff going on in the background&quot;, he recalled. &quot;I told them I'd write a song specially for the riff. So they said, 'Yes. You go away and do that', knowing that we'd almost finished the album Beatles for Sale. Anyway, going into the studio one morning, I said to Ringo, 'I've written this song but it's lousy'. But we tried it, complete with riff, and it sounded like an A side, so we decided to release it just like that.&quot;

Two different music videos directed by Joe McGrath were filmed. Both feature various bits of gym equipment. In one, George, Paul and John perform the song while Ringo rides the exercise bike. In the other they are all eating Fish and Chips, while trying to mime to the song.

The Beatles were an English rock band formed in Liverpool in 1960. They became the most commercially successful and critically acclaimed act in the rock music era. The group's best-known lineup consisted of John Lennon, Paul McCartney, George Harrison, and Ringo Starr. Rooted in skiffle and 1950s rock and roll, the Beatles later utilized several genres, ranging from pop ballads to psychedelic rock, often incorporating classical and other elements in innovative ways. In the early 1960s, their enormous popularity first emerged as &quot;Beatlemania&quot;, but as their songwriting grew in sophistication, they came to be perceived by many fans and cultural observers as an embodiment of the ideals shared by the era's sociocultural revolutions. 
